import React from 'react';
import './app.css';
import Greeting from './components/hello'
import Themes from './components/theme'

function App() {

  const userId = 3;

  return (
    <div className="App">
      <Greeting id = {userId}/>
      <Themes imgDir = "../public/img/"/>
    </div>
  );
}

export default App;
